import * as React from 'react';
import { useState, useEffect } from 'react';
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import Typography from '@mui/material/Typography';
import SendIcon from '@mui/icons-material/Send';
import { useNavigate } from 'react-router-dom';
import { Button, CardActionArea, CardActions } from '@mui/material';
import './EnrollCourses.css';
import YouTube from 'react-youtube'; // Import YouTube component

const EnrollCourses = () => {
    const [enrolledCourses, setEnrolledCourses] = useState([]);
    const [showPlayer, setShowPlayer] = useState(false);
    const [videoId, setVideoId] = useState('');
    let storedStudentDetails = localStorage.getItem('student');
    try {
        storedStudentDetails = JSON.parse(storedStudentDetails);
    } catch (error) {
        console.log(error);
    }

    useEffect(() => {
        const fetchData = async () => {
            try {
                const storedStudentDetails = JSON.parse(localStorage.getItem('student'));
                const studentId = storedStudentDetails._id;
                const response = await fetch(`http://localhost:4850/showEndrolledCourses/${studentId}`);
                if (!response.ok) {
                    throw new Error('Failed to fetch data');
                }
                const data = await response.json();
                console.log("Fetched data:", data);
                setEnrolledCourses(data);
            } catch (error) {
                console.error('Error fetching data:', error);
            }
        };
        fetchData();
    }, []);

    const startWatching = (videoId) => {
        setVideoId(videoId);
        setShowPlayer(true);
    };

    const unEnrollCourse = async (courseId) => {
        console.log('Clicked on course with ID:', courseId);
        const studentId = storedStudentDetails._id;
        try {
            const response = await fetch(`http://localhost:4450/unEnrollCourse/${studentId}`, {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json'
                },
                body: JSON.stringify({ courseId })
            });
            if (!response.ok) {
                throw new Error('Failed to unenroll from the course');
            }
            const data = await response.json();
            console.log('Successfully unenrolled from the course:', data);
            alert("Course unenrolled successfully");
            window.location.reload();
        } catch (error) {
            console.error('Error unenrolling from the course:', error);
        }
    };

    return (
        <div className="enrolled-courses-container">
            {enrolledCourses.length > 0 ? (
                enrolledCourses.map((course) => (
                    <Courses
                        key={course._id}
                        id={course._id}
                        title={course.name}
                        description={course.description}
                        image={course.image}
                        videoId={course.videoId} // Pass videoId as a prop
                        startWatching={() => startWatching(course.videoId)} // Pass startWatching function as a prop
                        unEnroll={() => unEnrollCourse(course._id)}
                    />
                ))
            ) : (
                <Typography>No courses found</Typography>
            )}
            {showPlayer && <YouTube videoId={videoId} />} {/* Render YouTube component conditionally */}
        </div>
    );
};

const Courses = ({ id, title, description, image, videoId, startWatching, unEnroll }) => {
    const navigate = useNavigate();
    return (
        <Card className="course-card">
            <CardActionArea>
                <CardMedia
                    component="img"
                    height="200"
                    image={image}
                    alt={title}
                />
                <CardContent>
                    <Typography gutterBottom variant="h5" component="div">
                        {title}
                    </Typography>
                    <Typography variant="body2" color="text.secondary">
                        {description}
                    </Typography>
                </CardContent>
            </CardActionArea>
            <CardActions className="course-actions">
                <Button size="small" color="primary" startIcon={<SendIcon />} onClick={startWatching}>
                    Start Watching
                </Button>
                <Button size="small" color="primary" startIcon={<SendIcon />} onClick={unEnroll}>
                    Unenroll
                </Button>
            </CardActions>
        </Card>
    );
};

export default EnrollCourses;
